 React.useEffect(() => {

  JSON.parse(window.localStorage.getItem('ACTIVE')) !== true && navigation('/');
  window.setTimeout(() => {
   setOpen(false);
  }, 7600);

 }, []);

 return (



  <ReturnAcTif />
 );
};
